import { useState } from 'react';
import './AgentDetails.css';

// Import icons
const imgWest = "http://localhost:3845/assets/dab477c6ade2d19b6d463e2d6994e32669d7440c.svg";
const imgVector1 = "http://localhost:3845/assets/9fc49a8ad4582ec588abb9db25500f5811dbc74c.svg";
const imgPerson = "http://localhost:3845/assets/627d492e7c95cfbccc4574266f4dce2d0ee267c5.svg";
const imgCall = "http://localhost:3845/assets/ef6e5e33bf0c7a55016af261878a9906b26dd5b9.svg";
const imgVector4 = "http://localhost:3845/assets/20f6037d1e0458230bce762850b2ffc99fe936cb.svg";
const imgLine = "http://localhost:3845/assets/3873aadcd49ad269806198541057edcaf8fbb825.svg";

function AgentDetails({ agent, onBack }) {
  const [callHistory] = useState([
    { 
      fileName: 'crisis_call_2024_01_15_14_30.wav', 
      date: 'Jan 15, 2024', 
      score: '87 / 100' 
    },
    { 
      fileName: 'family_intervention_2024_01_15_14_30.wav', 
      date: 'Jan 15, 2024', 
      score: '80 / 100' 
    },
    { 
      fileName: 'follow_up_2024_01_15_14_30.wav', 
      date: 'Jan 15, 2024', 
      score: '85 / 100' 
    },
    { 
      fileName: 'teen_support_2024_01_15_14_30.wav', 
      date: 'Jan 15, 2024', 
      score: '67 / 100' 
    },
    { 
      fileName: 'crisis_intervention_2024_01_15_14_30.wav', 
      date: 'Jan 15, 2024', 
      score: '77 / 100' 
    }
  ]);

  return (
    <div className="agent-details-container">
      {/* Header with back button */}
      <div className="agent-details-header">
        <div className="back-button" onClick={onBack}>
          <img src={imgWest} alt="Back" className="back-icon" />
        </div>
        <h2 className="header-title">Agent Details</h2>
      </div>

      <div className="agent-details-content">
        {/* Agent Profile Card */}
        <div className="agent-profile-card">
          <div className="agent-avatar-large">
            <img src={agent.avatar} alt="" className="avatar-bg-large" />
            <div className="avatar-icon-container">
              <img src={imgPerson} alt="" className="avatar-icon-large" />
            </div>
          </div>
          <h2 className="agent-name-large">{agent.name}</h2>
          <p className="agent-contact-id">Contact ID: {agent.contactId}</p>
        </div>

        {/* Call History Card */}
        <div className="call-history-card">
          <div className="call-history-header">
            <div className="call-icon-container">
              <img src={imgCall} alt="Call" className="call-icon" />
            </div>
            <h2 className="call-history-title">Call History</h2>
          </div>

          <div className="call-history-table">
            <div className="table-header">
              <div className="column file-name-column">File Name</div>
              <div className="column date-column">Date</div>
              <div className="column score-column">Score</div>
            </div>
            <div className="table-divider"></div>

            {callHistory.map((call, index) => (
              <div key={index} className="table-row-container">
                <div className="table-row">
                  <div className="column file-name-column">{call.fileName}</div>
                  <div className="column date-column">{call.date}</div>
                  <div className="column score-column">{call.score}</div>
                </div>
                <div className="table-divider"></div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default AgentDetails;
